          <Stack.Screen name="Products" component={Products} />
                    <Stack.Screen name="Begin" component={Begin} />
          <Stack.Screen name="Register" component={Register} />
          <Stack.Screen name="Login" component={Login} />
          
          */}

          

          

          
          
        </Stack.Navigator>
      </NavigationContainer>
    </GluestackUIProvider>
    </AuthProvider>
  );
}
